import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const Ads = () => {
  return (
    <View style={styles.conatainer}>
      
    </View>
  )
}

export default Ads

const styles = StyleSheet.create({
    conatainer: {
        width: '100%',
        height: 100,
        backgroundColor: 'red'
    }
})
